function getDateDifference(e){const o=new Date("21 May, 2006");let a=e-o,t=Math.floor(a/864e5),r=0,n=0;for(;t>=365;){let e=new Date(o.getFullYear()+n+1,0,0).getTime()-new Date(o.getFullYear()+n,0,0).getTime(),a=Math.floor(e/864e5);if(!(t>=a))break;n++,t-=a}for(;t>=30;){let e=new Date(o.getFullYear()+n,o.getMonth()+r+1,0).getDate();if(!(t>=e))break;r++,t-=e}return{days:t,months:r,years:n}}async function preloadAudio(e){try{const o=await fetch("https://cdn.theflyingrat.com/assets/joeymanani/assets/"+e+".wav"),a=await o.arrayBuffer(),t=arrayBufferToBase64(a);localStorage.setItem(e,t)}catch(e){console.log("Error preloading audio: "+e)}}function arrayBufferToBase64(e){const o=new Uint8Array(e);let a="";for(let e=0;e<o.length;e++)a+=String.fromCharCode(o[e]);return btoa(a)}function base64ToArrayBuffer(e){const o=atob(e),a=new Uint8Array(o.length);for(let e=0;e<o.length;e++)a[e]=o.charCodeAt(e);return a.buffer}function playSound(e){try{let o;audioThread1.paused?(audioThread1.src=audioBlobURLs[e],o=audioThread1.play()):(audioThread2.src=audioBlobURLs[e],o=audioThread2.play()),o&&o.catch(function(e){"NotAllowedError"===e.name?console.log("User didn't interact. Can't play sound!"):console.log("Error playing sound: "+e)})}catch(e){console.log("Couldn't play sound because of error: "+e)}}function sleep(e){return new Promise(o=>setTimeout(o,e))}const audioThread1=new Audio,audioThread2=new Audio,audioFiles=["click","success","alert","enter","backspace","button"];audioFiles.forEach(e=>{const o=localStorage.getItem(e);o||preloadAudio(e)});const audioBlobURLs={};audioFiles.forEach(e=>{const o=localStorage.getItem(e),a=base64ToArrayBuffer(o),t=new Blob([a],{type:"audio/wav"});audioBlobURLs[e]=URL.createObjectURL(t)});